import React from 'react';

const Parent = () => (
  <div>
    <p>Child 1</p>
    <p>Child 2</p>
  </div>
);

const FiberArchitecture = () => {
  const parentString = "<Parent/>";
  return (
    <div>
      <h2>Fiber Architecture:</h2>
      {console.log("Parent Fiber", (<Parent />)._owner)}
      {console.log("Parent of Parent Fiber", (<Parent />)._owner.return)}
      <p>
        Parent of {parentString} fiber - {parentString}._owner.return
      </p>
      <p>
        {parentString} fiber - {parentString}._owner
      </p>
      <p>Child 1 fiber - {parentString}._owner.child</p>
      <p>Child 2 fiber - {parentString}._owner.child</p>
    </div>
  );
};

export default FiberArchitecture;
